// src/components/Home.js
import React from 'react';


// Sample images (replace these with actual images)
const bannerImage = "./assets/images/res02.jpg";
const serviceImage1 = "https://via.placeholder.com/400x300";
const serviceImage2 = "https://via.placeholder.com/400x300";
const serviceImage3 = "https://via.placeholder.com/400x300";

const Home = () => {
  return (
    <div style={styles.container}>
      {/* Banner Section */}
      <div style={styles.banner}>
        <img src={bannerImage} alt="Restaurant Banner" style={styles.bannerImage} />
        <div style={styles.bannerText}>
          <h1>Welcome to ABC Restaurant</h1>
          <p>Your Culinary Journey Begins Here</p>
          <button style={styles.exploreButton}>Explore Our Menu</button>
        </div>
      </div>

      {/* Services Section */}
      <div style={styles.servicesSection}>
        <h2 style={styles.sectionTitle}>Our Services</h2>
        <div style={styles.services}>
          <div style={styles.serviceCard}>
            <img src={serviceImage1} alt="Service 1" style={styles.serviceImage} />
            <h3>Dine-In</h3>
            <p>Experience our exquisite dining experience in a luxurious environment.</p>
          </div>
          <div style={styles.serviceCard}>
            <img src={serviceImage2} alt="Service 2" style={styles.serviceImage} />
            <h3>Delivery</h3>
            <p>Enjoy our gourmet meals delivered right to your doorstep.</p>
          </div>
          <div style={styles.serviceCard}>
            <img src={serviceImage3} alt="Service 3" style={styles.serviceImage} />
            <h3>Event Catering</h3>
            <p>Let us cater your events with our exclusive dishes and services.</p>
          </div>
        </div>
      </div>

      {/* Offers Section */}
      <div style={styles.offersSection}>
        <h2 style={styles.sectionTitle}>Special Offers</h2>
        <p>Check out our latest offers and discounts available for a limited time.</p>
        <button style={styles.offersButton}>View Offers</button>
      </div>

      {/* Gallery Section */}
      <div style={styles.gallerySection}>
        <h2 style={styles.sectionTitle}>Gallery</h2>
        <p>Explore photos of our ambiance, dishes, and happy customers.</p>
        <button style={styles.galleryButton}>View Gallery</button>
      </div>

      {/* Contact Us Section */}
      <div style={styles.contactSection}>
        <h2 style={styles.sectionTitle}>Contact Us</h2>
        <p>Have any questions or need to make a reservation? Get in touch with us!</p>
        <button style={styles.contactButton}>Contact Us</button>
      </div>
    </div>
  );
};

// Inline CSS styles
const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    color: '#333',
  },
  banner: {
    position: 'relative',
    width: '100%',
    height: '600px',
    overflow: 'hidden',
  },
  bannerImage: {
    width: '100%',
    height: '100%',
    objectFit: 'cover',
    filter: 'brightness(50%)',
  },
  bannerText: {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: 'white',
    textAlign: 'center',
  },
  exploreButton: {
    marginTop: '20px',
    padding: '10px 20px',
    backgroundColor: '#FF6347',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  servicesSection: {
    padding: '50px 20px',
    textAlign: 'center',
  },
  sectionTitle: {
    fontSize: '36px',
    marginBottom: '30px',
  },
  services: {
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  serviceCard: {
    width: '300px',
    margin: '20px',
    textAlign: 'center',
    boxShadow: '0px 4px 6px rgba(0, 0, 0, 0.1)',
    borderRadius: '10px',
    overflow: 'hidden',
  },
  serviceImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  offersSection: {
    padding: '50px 20px',
    textAlign: 'center',
    backgroundColor: '#f8f8f8',
  },
  offersButton: {
    marginTop: '20px',
    padding: '10px 20px',
    backgroundColor: '#FF6347',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  gallerySection: {
    padding: '50px 20px',
    textAlign: 'center',
  },
  galleryButton: {
    marginTop: '20px',
    padding: '10px 20px',
    backgroundColor: '#FF6347',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  contactSection: {
    padding: '50px 20px',
    textAlign: 'center',
    backgroundColor: '#FF6347',
    color: 'white',
  },
  contactButton: {
    marginTop: '20px',
    padding: '10px 20px',
    backgroundColor: 'white',
    color: '#FF6347',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
};

export default Home;
